$(document).ready(() => {
    var id = 3; /* ALTO VALE DO ITAJAI */
    fetch(base_url + "/api/vacinacao-por-regiao/" + id)
        .then((response) => {
            return response.json();
        }).then((dados) => {
            /* Ocupacao de Leitos */
            var vacinas = [dados.vacinados_D1, dados.vacinados_D2];

            var ol_layout = {
                title: "Vacinados 1ª Dose / Vacinados 2ª Dose ",
                barmode: "stack",
                bargap: 0.5,
                bargroupgap: 0.2,
                yaxis: {
                    tickformat: '.2%',
                }
            };

            var config = { responsive: true };

            Plotly.newPlot("vacina-graph", vacinas, ol_layout, config);
        })
        .catch((err) => console.error(err));

    fetch(base_url + "/api/vacinacao-ms-por-regiao/"+ id)
        .then((response) => {
            return response.json();
        }).then((dados) => {

            var vacinas = [dados.vacinados_D1, dados.vacinados_D2];

            var mm_layout = {
                title: 'Vacinação 2ª Dose + Dose Única da População geral - fonte: <a href="https://opendatasus.saude.gov.br/dataset/covid-19-vacinacao">OpenDatasus</a>',
                showlegend: true,
                yaxis: {
                    tickformat: '.2%',
                }

            };

            var config = { responsive: true };

            Plotly.newPlot("vacina-ms-graph", vacinas, mm_layout, config);
        })
    .catch((err) => console.error(err));
        

    fetch(base_url + '/api/rt-por-regiao/' + id).then(response => {
        return response.json()
    }).then(dados => {
        /* R(t) */
        var rt = [
            {
                x: dados.datas,
                y: dados.rt,
                type: 'scatter'
            }
        ];
        var rt_layout = {
            title: 'Taxa de Transmissibilidade R(t)',
        };
        var config = { responsive: true }
        Plotly.newPlot('rt-graph', rt, rt_layout, config);
    }).catch(err => console.error(err));

    fetch(base_url + '/api/rt-predict-por-regiao/' + id).then(response => {
        return response.json()
    }).then(dados => {
        /* R(t) */
        var rt = dados['regionais'][id];
        var rt_layout = {
            title: 'Taxa de Transmissibilidade R(t) 15 dias + predição 5 dias',
        };
        var config = { responsive: true }
        Plotly.newPlot('rt-predict-graph', rt, rt_layout, config);
    }).catch(err => console.error(err));

    fetch(base_url + '/api/casos-por-regiao/' + id).then(response => {
        return response.json()
    }).then(dados => {
        $("#dataAtualizacao").text(dados.maiorData);

        /* Casos / Casos média móvel */
        var casos = {
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.casos,
            line: { color: '#17BECF' },
            name: "Casos"
        }

        var casos_media_movel = {
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.casos_media_movel,
            line: { color: '#FF0000' },
            name: "Casos Média Móvel"
        }
        dados_casos = [casos, casos_media_movel]

        var mm_layout = {
            title: 'Casos X Casos Média Móvel',
        };

        var config = { responsive: true }
        Plotly.newPlot('casos-graph', dados_casos, mm_layout, config);

        /* Óbitos / Óbitos média móvel */
        var obitos = {
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.obitos,
            line: { color: '#17BECF' },
            name: "Óbitos"
        }

        var obitos_media_movel = {
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.obitos_media_movel,
            line: { color: '#FF0000' },
            name: "Óbitos Média Móvel"
        }
        dados_obitos = [obitos, obitos_media_movel]

        var mm_layout = {
            title: 'Óbitos X Óbitos Média Móvel',
        };

        var casos_media_movel = {
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.casos_media_movel,
            line: { color: '#FF0000' },
            name: "Casos Média Móvel"
        }

        var config = { responsive: true }
        Plotly.newPlot('obitos-graph', dados_obitos, mm_layout, config);

        // Incidência
        var dados_incidencia = [{
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.incidencia,
            line: { color: '#FF0000' },
            name: "Casos Média Móvel"
        }];

        var mm_layout = {
            title: "Incidência acumulada por 100 mil habitantes"
        };

        var config = { responsive: true }
        Plotly.newPlot('incidencia-graph', dados_incidencia, mm_layout, config);


        // Letalidade
        var dados_letalidade = [{
            type: "scatter",
            mode: "lines",
            x: dados.datas,
            y: dados.letalidade,
            line: { color: '#FF0000' },
            name: "Casos Média Móvel"
        }];

        var mm_layout = {
            title: "Letalidade - Óbitos / número de casos (em %)",
        };

        var config = { responsive: true }
        Plotly.newPlot('letalidade-graph', dados_letalidade, mm_layout, config);

    }).catch(err => console.error(err));

    fetch(base_url + "/api/leitos-por-regiao/" + id)
        .then((response) => {
            return response.json();
        })
        .then((dados) => {
            /* Ocupacao de Leitos */
            var ocupacao_leitos = [dados.leitos_ocupados, dados.leitos_disponiveis];

            var ol_layout = {
                title: "Leitos Totais / Ocupados (UTI - Covid Adulto)",
                barmode: "stack",
                bargap: 0.5,
                bargroupgap: 0.2,
            };

            var config = { responsive: true };

            Plotly.newPlot("leitos-graph", ocupacao_leitos, ol_layout, config);
        })
        .catch((err) => console.error(err));

});